function Fox() {}
Fox.prototype = {
  init: function() {
    "undefined" != typeof notices && this.show_notices(notices)
  },
  is_undefined: function(a) {
    return void 0 == a
  },
  is_defined: function(a) {
    return !this.is_undefined(a)
  }
}, $fox = new Fox, $fox.init()

